	/**
	 * Given starting and ending element, this methods resolves to the correct
	 * {@link PropagationRuleTypes}
	 * 
	 * @param from
	 * @param to
	 * @return
	 */
	public static PropagationRuleTypes resolve(ArchitecturalElementTypes from, ArchitecturalElementTypes to) {
		String key = from + "_TO_" + to;
		return fromElementTypeToElementTypeResolverMap.get(key);
	}

